import React, { useState } from "react";
import "./loginpage.css";
import { BrowserRouter, Link } from "react-router-dom";
import { UserContext } from "../../UserContext.js";
// import { socket } from "../client.js";

function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const { updateUser } = useContext(UserContext);

  const [errors, setErrors] = useState({});
  const navigate = useNavigate();
  const handleLogin = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch(`http://localhost:3000/users/login`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ email, password }),
        credentials: "include",
      });

      if (response.ok) {
        const data = await response.json();
        const loggedInUser = data.userData;
        localStorage.setItem("id", loggedInUser.id);
        localStorage.setItem("user", JSON.stringify(loggedInUser));
        updateUser(loggedInUser);

        // socket.emit("user_connected", { userID: loggedInUser.id });
        // let uid = loggedInUser.id;

        // socket.on("mentor_online", (data) => {
        //   alert(`Your connected mentor ${data.mentorID} is now online!`);
        // });
        // socket.on("mentee_online", (data) => {
        //   alert(`Your connected mentee ${data.menteeID} is now online!`);
        // });

        const profileCheckResponse = await fetch(
          `http://localhost:3000/profile/${loggedInUser.id}`,
          {
            method: "GET",
            headers: {
              "Content-Type": "application/json",
            },
            credentials: "include",
          }
        );

        if (profileCheckResponse.ok) {
          const data = await profileCheckResponse.json();
          if (data.accountType === "Mentee") {
            navigate("/mentee");
          } else {
            navigate("/mentor");
          }
        } else {
          navigate("/home");
        }
      } else {
        alert("Login failed");
      }
    } catch (error) {
      alert("Login failed: " + error);
    }
  };

  return (
    <div className="wrapper">
      <div className="content">
        <h1 className="welcome-text">Welcome to Mentor_Me🎓</h1>
        <div className="account-type">
          <div className="mentor"></div>
          <div className="mentee"></div>
        </div>
        <p className="welcome">Enter your Email and Password</p>
        <div className="user-information">
          <form>
            <div className="user-email">
              <label htmlFor="email">
                <strong>Email</strong>
              </label>
              <input
                type="email"
                placeholder="Enter Email"
                name="email"
                onChange={(e) => setEmail(e.target.value)}
                required
              />
              {errors.email && (
                <span className="text-danger">{errors.email}</span>
              )}
            </div>
            <div className="user-password">
              <label htmlFor="password">
                <strong>Password</strong>
              </label>
              <input
                type="password"
                placeholder="Enter Password"
                name="password"
                onChange={(e) => setPassword(e.target.value)}
                required
              />
              {errors.password && (
                <span className="text-danger">{errors.password}</span>
              )}
            </div>
            <button type="submit" className="btn-success">
              Log in
            </button>
            <p>You agree to our terms and policies</p>
            <Link to="/signup" className="create-account-btn">
              Create Account
            </Link>
          </form>
        </div>
      </div>
      <div className="image-container">
        <img
          src="https://www.genesecloud.academy/wp-content/uploads/2021/02/mentor-1.svg"
          alt="Mentorship"
        />
      </div>
    </div>
  );
}

export default Login;
